const Pagination = ({todosPerPage, todos}) => {
    const pageNr = [];


    for(let i = 1; i <= Math.ceil(todos / todosPerPage); i++){
        pageNr.push(i);
    }
    return (
        <nav>
            <ul>
                {pageNr.map(number => (
                    <li key={number}>
                        <a href="!#"> {number}</a>
                    </li>
                ))}
            </ul>

        </nav>
    )
}

export default Pagination
